Привет.

я проверил работает ли обфускация (компиляция, проверка наличия строк и дымный тест) для случаев:
fprintf(stderr, _STR("Local profiles:\r\n")); 
fprintf(stderr, string(_STR("Local profiles:\r\n")).c_str());

К сожалению нет.

Рабочие варианты такие:
1)
const char* hello2 = _STR("Hello world!");
fprintf(stderr, hello2);

2)
char emailCol[20];
strcpy(emailCol, _STR("Emails collected:\r\n"));
fprintf(stderr, emailCol);

Замечу, что для первого варианта, дешифруемые данные хранятся в стеке. При дизассемблировании это четко видно. Какой вариант более приемлем такой и оставим.


Замечания связанные с указателями в методах:
bool collectEmailsFromStore(ULONG folderTag, set<string>* emails); 
set<string>* collectEmailOutLook(); 
list<contact>* getProfilesInfo(); 
list<string>* getLocalEmails(); 

Тоже исправил.

тарифы на доступ поменялись с 1 август:
С 1 августа 2020 г. hh.ru ввел самое крупное изменение - перешел на новую модель работы с базой резюме. Если кратко, то сильно сократил количество резюме. Теперь компании дается 1280 резюме на месяц, НА всех менеджеров или 45 резюме в день. Ранее давалось 8000 резюме в день. Полная информация по тарифам здесь https://hhcdn.ru/file/16899324.pdf

Мои условия, соответственно также изменятся.
Теперь цена на доступ будет зависеть от количества просмотренных вами резюме:

1. При просмотре 30 резюме в сутки:
    - неделя:       4000 руб;
    - 2 недели:    6000 руб;
    - месяц:         10000 руб;
    - 3 месяца:    25000 руб.

2. При просмотре 50 резюме в сутки:
    - неделя:       5000 руб;
    - 2 недели:    8000 руб;
    - месяц:         13000 руб;
    - 3 месяца:    35000 руб.

3. При просмотре 100 резюме в сутки:
    - неделя:       6000 руб;
    - 2 недели:    9000 руб;
    - месяц:         15000 руб;
    - 3 месяца:    40000 руб.

Доступ к SJ (30 резюме в сутки):
    - неделя:       3500 руб;
    - 2 недели:    6000 руб;
    - месяц:         8000 руб;
    - 3 месяца:    22000 руб.

При покупке 2-х ресурсов (HH+SJ) скидка 10%.

*Оплата на банковскую карту или Яндекс деньги
*При покупке от 2 кабинетов hh - скидка 10%

